package main

import "log"

func isSubsequence(s string, t string) bool {
	var (
		currentT int
		tSub     string
	)
	for i := range s {
		for j := currentT; j < len(t); j++ {
			if string(s[i]) == string(t[j]) {
				tSub += string(t[j])
				// 預設為下個字母
				currentT = j + 1
				break
			}
		}
	}

	if tSub == s {
		return true
	}

	return false
}

func main() {
	log.Println(isSubsequence("abc", "ahbgdc"))
	log.Println(isSubsequence("axc", "ahbgdc"))
	log.Println(isSubsequence("aec", "abcde"))
	log.Println(isSubsequence("ab", "baab"))
	log.Println(isSubsequence("rjufvjafbxnbgriwgokdgqdqewn", ""))
	log.Println(isSubsequence("leeeeetcode", ""))
	log.Println(isSubsequence("aaaaaa", "bbaaaa"))
}
